	<wpt lat="46.3692" lon="13.6704">
	<ele>2342</ele>
	<name>Bavški Grintavec</name>
	<cmt>BAVŠKI GRINTAVEC, 2347 m, je najpomembnejši vrh v j. delu dolgega pogorja, ki se vleče v poldnevniški smeri od Ponc prek Jalovca do Bavškega Grintavca in spada v Jalovčevo gorsko skupino. Na Bavškem Grintavcu se nanj naslanja poševno pogorje med Zgornjo Trento ter sotočjem Koritnice in Soče s Plešivcem (2008 m), Trentskim Pelcem (2109 m) in Srebrnjakom (2100 m) na v. strani Grintavca, do Svinjaka (1653 m), koničastega vrha na sv. strani Bovške kotline. V pogorju proti Jalovcu se zvrsti več vrhov, med njimi so najpomembnejši Skutnik (2172 m), Nizki vrh (2162 m), Zadnji Pelc (2315 m), Srednji Pelc (2336 m), Veliki Pelc (2388 m) in Pelc nad Kionicami (2442 m). V. greben Bavškega Grintavca se strmo spušča na preval Velika Vrata (1794 m). Jv. pobočja padajo v Soško dolino pri vasi Soča. Jv. greben se prek bližnjega Malega Grintavca (2282 m) spušča proti Svinjaku, s. greben pa strmo na bližnji Kanski preval. Na sv. strani vrha je kratka stena, naprej so gruščnata in rušnata pobočja nad planino Zapotok nad Zadnjo Trento. Bavški Grintavec je imeniten vrh. Najlepši pogled nanj je z Vršiča in s poti z Vršiča po pobočju Mojstrovke in Travnika proti Jalovcu, odkoder vidimo vso njegovo s. stran nad Zadnjo Trento. Razgled z vrha je zelo lep, zlasti na bližnje skalnate vrhove, grebene in doline. Proti v. so pred nami vrhovi med Zadnjo Trento na s. in Spodnjo Trento na j. strani. V tej smeri vidimo Vršič in na njegovi desni vrhove vzhodnih Julijcev s Prisojnikom, Razorjem, Triglavom, Kanjavcem in Velikim Špičjem. Na j. strani se nad dolino Soče dviga Krnska skupina, v kolenu Soče pa greben Polovnika. Na jz. je nad Bovško kotlino obširno Kaninsko pogorje, kjer izstopa Rombon na njegovem v. robu; pred Kaninskim pogorjem je gorska dolina Bavšica in na njeni s. strani dolgi greben Loške stene. Proti s. se zvrstijo Skutnik, Pelci, Veliki Ozebnik in Jalovec, na njegovi levi Mangrt, na desni pa Šite, Travnik in Mojstrovka, globoko spodaj leži dolina Zadnje Trente.</cmt>
	</wpt>
