	<wpt lat="46.4216" lon="13.6801">
	<ele>2639</ele>
	<name>Jalovec</name>
	<cmt>Jalovec (2645 m) je med najlepše oblikovanimi vrhovi v Julijskih Alpah. S s. strani je videti s svojimi skoraj navpičnimi stenami ter ostrimi in pravilnimi robovi kot strm stožec. lz sklepa doline Planice kaže strmo sv. in s. steno. Na Kotovo sedlo (2134 m) na sz. strani se strmo spušča sz. greben; tu se navezuje na verigo Ponc. Od grebena Travnika na v. ga loči globoko zasekani Jalovčev ozebnik. V dolino Koritnice na j. strani pada razdrapana jz. stena. Od koderkoli gledamo v to smer, takoj spoznamo njegov značilni vrh. Jalovčeva skladna lepota pa nas prevzame zlasti s Slemena, iz doline Planice in od Kugyjevega spomenika v Zgornji Trenti. Čeprav je Triglav naša najvišja gora in narodni simbol, je Planinska zveza Slovenije vzela podobo Jalovca za svoj znak.</cmt>
	</wpt>
