	<wpt lat="46.5004" lon="14.7799">
	<ele>2121</ele>
	<name>Kordeževa glava (Peca)</name>
	<cmt>PECA je mogočna gora v severni verigi Karavank. S. pobočja se spuščajo v Podjuno, v. in j. proti Mežiški dolini, ozka dolina Bele pa na z. loči masiva Pece in Obirja. Peca je popolnoma koroška gora. Čez njo teče državna meja; ena tretjina gore je v naši državi, dve pa v Avstriji. Zgrajena je iz triasnih apnencev. Najvišji vrh je Kordeževa glava (2125 m), prek njega teče državna meja. J. stran vrha je skalnata in prepadna. Vrh ima ime po kmetiji Kordež v dolini Tople na j. strani gore. </cmt>
	</wpt>
