	<cmt>Kopasti vrh ne spada med gore, ki bi nas že od daleč vabili z drzno obliko, kljub temu pa se nam z nje odpira širok razgled. Na tem območju je vse okroglo in bolj položno kot strmo, prej počasi zaobljeno kot robato. Dolina Gracije in Lepe Komne skalnati je svet, na planini Poljanica sledi ogradi še devet.</cmt>
