	<wpt lat="46.4395" lon="13.6546">
	<ele>2675</ele>
	<name>Mangart</name>
	<cmt>MANGRT ali MANGART, 2679 m, je najvišja gora v Jalovčevi gorski skupini, ki se razteza od Vršiča na vzhodu do Rabeljske doline na zahodu ter med prelazom Predel, dolino Koritnice in Soško dolino na jugu do Doline ob zgornji Savi in doline reke Bele na severu. Mangrt je v tej gorski skupini pravzaprav pogorje z več vrhovi, ki tvori pregrado med Mangrtsko dolino na s. in dolino Koritnice na j. Na v. prehaja ob Vevnici (2343 m) v gorski sklop Jalovca. V škrbini Čez Jezik (2055 m) na z. strani glav¬nega vrha, končuje osrednji masiv; od tod se pogorje v loku znižuje proti jz. do Predelske glave (1618 m) nad prelazom Predel (1156 m), kjer prehaja v Kaninske gore. Pogorje je zgrajeno večinoma iz triasnih in jurskih apnencev. Po glavnem grebenu od Vevnice do Predela teče slovensko-italijanska državna meja. Poleg Mangrta so pomembnejši vrhovi še: na v. strani Koritniški Mali Mangrt (2333 m) s strmo in gladko steno, Rateški Mali Mangrt (2259 m) in Strmi nos (2197 m) na s. strani, Rdeča skala (2094 m) j. od vrha ter Skala (2133 m), Grintavec (1943 m) in Skutnik (1865 m) v loku proti Predelu. S slovenske strani državne meje pelje markirana pot le na Mangrt. Najlepši pogled na masiv Mangrta je iz Mangrtske doline, kamor padajo strme stene Mangrta in bližnjih sosedov. V dolini sta dve čudovito lepi Mangrtski (Belopeški) jezeri, v katerih se zrcali podoba Mangrta; do jezer pripelje cesta iz Fužin (Fusine), 4 km. J. pobočja Mangrta, ki strmo padajo v dolino Koritnice, so v zgornjih delih skalnata in gruščnata, nižje nad dolino pa travnata in razbrazdana z globokimi grapami; tod izvira reka Koritnica. Nad Koritniško dolino je leta 1909 Akademski krožek Češke podružnice SPD iz Prage odprl Češko kočo v Koritnici, ki pa je med obema vojnama propadla. Mangrt je bogat z alpsko floro. Na njem raste plazeča sretena, ki ima tod edino rastišče v Sloveniji. Med redkimi in ogroženimi rastlinami rastejo na Mangrtu islandska potočarka, klasnati ovsenec, živorodna bilnica in črni pelin. Na območju Mangrta je tudi eno redkih gnezdišč planinskega hudournika. Ostenja Mangrta, zlasti na njegovi s. strani, so privlačni cilj alpinistov. Prvi se je na Mangrt povzpel leta 1794 grof Franz Hohenwart, med prvimi pristopniki pa je bil tudi Valentin Stanič. Razgled z Mangrta je med najlepšimi v Julijskih Alpah. Proti v. se v bližini dvigajo Mali Mangrt, Kotova špica, Travnik in Mojstrovke, potem pa seže pogled prek Prisojnika, Razorja in Pihavca vse do Triglava. Na jv. se pogled najprej ustavi na Jalovcu, ki se pne nad Kotovim sedlom, potem pa zdrsi do Kanjavca in Velikega Špičja. Na j. je globoko pod nami dolina Koritnice z Logom pod Mangrtom, nad njo pa se vleče dolgi gorski greben s skupnim imenom Loška stena, ki ločuje Koritnico od doline Bavšice. V tej smeri vidimo Krn in morje v Tržaškem zalivu. Proti zahodu se nad razgibano Beneško Slovenijo in ravno Furlanijo dvigajo Kaninske gore. Na z. strani vrha je Mangrtsko sedlo (2072 m) in obširna planota pod njim, kamor pripelje najvišja cesta v Sloveniji; od sedla do Predela pa se počasi niža jz. lok Mangrtskega pogorja. V z. smeri imamo čudovit pogled na Zahodne Julijce z Višem in Poliškim Špikom ali Špikom nad Policami (Montažem) ter ob dobri vidljivosti proti Dolomitom. Na s. je globoko pod nami gozdnata planota z Mangrtsko dolino in Mangrtskima jezeroma, ki jo na v. strani ločuje greben Ponc od Planice, naprej pa se dviguje mogočni Dobrač, če je čisto ozračje pa vidimo na obzorju Visoke in Nizke Ture.</cmt>
	</wpt>
