	<wpt lat="46.237" lon="14.0829">
	<ele>1676</ele>
	<name>Altemaver</name>
	<cmt>JELOVICA je zakrasela alpska planota med Kropo, Kamno Gorico in Lancovim na s., Savo Bohinjko na z. in Selško Soro na j. Na s. strani je visoka od 1000–1100 m, na j. pa od 1200–1400 m. Najviše se vzpne na območju Ratitovca (Altemaver, 1678 m), ki je strm rob planote. Jelovica je zgrajena iz apnencev in triasnih dolomitov. Poraščena je z obširnimi gozdovi, ki so jih ponekod izsekali in tam uredili planine za pašo živine. Med gozdovi so številne kraške vrtače, kotliči, brezna in podzemne jame, pa tudi suhe doline. Ponekod so šotna barja, ki so ostanki ledeniških jezer. Kjer so tla neprepustna, opazimo tudi površinske vode. Planota je prepredena z gozdnimi cestami. Naselja so ob vznožjih, le nekaj jih je na pobočjih. Nekoč so na Jelovici kopali železovo rudo za fužine v Kropi in Železnikih, razvito pa je bilo tudi oglarstvo.</cmt>
	</wpt>
