	<wpt lat="46.1648" lon="14.1134">
	<ele>1562</ele>
	<name>Blegoš</name>
	<cmt>BLEGOŠ, 1562 m, je najvišji vrh Škofjeloškega hribovja. Na j. strani kopastega vrha so planinski pašniki, na s. pa skoraj do vrha sega po večini bukov gozd. Na pašnikih najdemo pomembno alpsko floro, kot so clusijev svišč, črna murka, čašasti sviščevec, pogačica in še številne druge. Z vrha se odpira prelep razgled na vse strani. Proti v. se v bližini zvrstijo Koprivnik, Mladi vrh in Lubnik, naprej pa Polhograjsko hribovje s Toščem ter Posavsko hribovje s Kumom. Na j. strani vidimo del Poljanske doline, nad njo hribe nad Žirmi in Idrijo, na obzorju Snežnik, Javornike in Trnovski gozd. Na z. je v bližini Porezen, potem pa Spodnje Bohinjske gore. Sz. se nad Selško dolino dviga Ratitovec, za njim pa vidimo Julijce s Triglavom. Na s. se nad gorenjsko ravnino dvigajo Karavanke in Kamniško-Savinjske Alpe, v bližini pa sta Dražgoška gora in Jelovica. Na Blegošu še stojijo betonske utrdbe Kraljevine Jugoslavije, ki naj bi varovale dostope iz takratne Italije v Selško in Poljansko dolino. Na vrhu je skrinjica z žigom in vpisno knjigo, panoramska tabla pa nam pomaga pri razgledu. </cmt>
	</wpt>
