	<wpt lat="46.2311" lon="13.9316">
	<ele>1843</ele>
	<name>Črna prst</name>
	<cmt>Črna prst (1844 m) je najvzhodnejši »visoki« vrh Spodnjih Bohinjskih gora: ime je dobila po temnem jurskem skrilavcu, ki ga vidimo sredi belega skalovja na s. strani vrha kot črno liso. s pobočje gore sprva strmo, potem pa položno pada v Bohinjsko. dolino; oklepata ga dva grebena, z. končuje Lisec (1o53 m), v. po Črna gora (160o m). Med obema grebenoma leži Planina za Liscem (1350 m), kjer je SPD leta 1894 zgradilo svojo prvo planinsko kočo in jo poimenovalo po tedanjem predsedniku SPD Franu Orožnu »Orožnova koča na Črni prsti«. J. travnata pobočja Črne prsti se strmo spuščajo v Baško grapo. Črna prst je bogata z alpsko floro; poleg sleča, planik, murk, košutnika in drugih cvetic raste tod srebrna krvomočnica (v Sloveniji le še v Krnskem pogorju); v stenah Črne gore raste kratkodlakava popkoresa, ki je ni najti nikjer drugje na svetu.</cmt>
	</wpt>
