	<wpt lat="46.4496" lon="14.6856">
	<ele>1925</ele>
	<name>Govca/Govešca (Olševa)</name>
	<cmt>OLŠEVA, 1929 m, je najvzhodnejša visokogorska gora v j. vrsti Karavank. Ozek, 5 km dolg gorski hrbet se na s. strmo spušča v zgornje porečje reke Meže. Tudi j. pobočja nad teraso s kmetijami v Podolševi so strma, v spodnjem delu nad ozko dolino Savinje pa položnejša. Na v. loči Olševo širok preval Sleme (1254 m) od Raduhe. Na z. prištevamo k Olševi tudi gozdnati greben do Pavličevega sedla (1339 m), v ožjem pomenu pa na tej strani sega Olševa do Strevčevega vrha (1466 m), kjer je bil stari prehod v Železno Kaplo na Koroškem. Olševo sestavljajo zgornjetriasni apnenci in dolomiti, vznožni deli pa so pretežno iz paleozojskih in kristalastih skrilavcev s položnejšimi pobočji, ki so jih izkrčili za samotne kmetije. Z. del gore je precej skalnat in težje prehoden. Smrekov gozd sega skoraj do višine 1700 m. Skrajni z. konec Olševe pripada Avstriji, ves greben z najvišjim vrhom Govco (1929 m) je v naši državi. Pomembnejša vrhova sta še Gladki vrh (1849 m) v. od Govce in Obel kamen (1911 m) nad Potočko zijalko, ki ga prečka državna meja. Po grebenu teče deželna meja med Stajersko in Koroško.  Razgled z Olševe je izredno lep, zlasti na Savinjske Alpe od  Ojstrice do Storžiča ter na gore v Karavankah s Košuto in Obirjem v ospredju ter na Peco in Uršljo goro na s. strani. Med Olševo in Peco se razprostirajo gozdnata pobočja med dolinama Koprivne in Tople s Čofatijevim vrhom. Proti v. se v bližini dvigata Lanež in Raduha, zadaj pa vidimo Smrekovško pogorje. Na j. strani se pogled ustavi na široki terasi, ki se vleče na višini okrog 1200 m od z. proti v. robu gore, po kateri so posejene samotne kmetije in kjer na z. strani stoji cerkev sv. Duha; s terase se spusti pogled na ozko dolino Savinje in v Matkov kot, Logarsko dolino in Robanov kot ter na vrhove, ki jih obkrožajo. </cmt>
	</wpt>
