	<wpt lat="46.6451" lon="15.03">
	<ele>1521</ele>
	<name>Košenjak (Hühnerkogel)</name>
	<cmt>KOŠENJAK 1522 m, je skrajni j. odrastek Glice (Koralpe), gorovja s. od Drave med Vičem pri Dravogradu in Muto, ki se na drugi strani državne meje v Avstriji širi proti severu med Labodsko dolino na z. in Graško kotlino na v. ter skupaj z drugimi gorovji tvori rob vzhodnih Alp. Najvišji vrh gorovja je Golica (Gr. Speikogel), 2141 m. Na jv. strani loči izrastke Glice od sosednjega Kozjaka globoka dolina Mučke Bistrice, ki ima povirje na Golici v Avstriji, v Dravo pa se izliva pri Muti. Na naši strani državne meje je velik jez, hidroelektrarna je v Avstriji. Glica je zgrajena pretežno iz kristalastih skrilavcev. Pretežni del gorstva poraščajo iglasti gozdovi, v višjih legah pa so tudi obsežnejše planinske senožeti.  Košenjak je najvišji vrh na s. strani Drave med Mariborom in državno mejo pri Viču. Čezenj teče državna meja. Doslej je bil bolj malo obiskan: ko se je po osamosvojitvi Slovenije sprostil obmejni režim in ko je bila odprta planinska postojanka, se nadejamo večjega obiska, ki si ga zaradi razgleda in prirodnih lepot tudi zasluži. Na prisojnih pobočjih so raztresene samotne kmetije; strnjenih vasi tod ni. Najpomembnejše središče na j. pobočju nad Dravogradom je na Ojstrici, (985 m) pri cerkvi sv. Janeza iz 15. stoletja, kjer so tudi šola, gostilna in trgovina. Na jv. izrastkih Glice, vz. od Košenjaka, so Pernice (1060 m) s središčem pri cerkvi sv. Simona, ki se omenja že leta 1368, kjer so tudi šola, gostišče, lovska koča in trgovina. Na Košenjaku so rastišča Kochovega svišča in širokolistne lobodike. V bližini doma lahko opazimo svizce, na širšem območju Košenjaka živijo tudi divji petelini in ruševci, med divjadjo pa se pojavlja tudi beli planinski zajec.</cmt>
	</wpt>
