	<wpt lat="46.2124" lon="13.5295">
	<ele>1639</ele>
	<name>Matajur</name>
	<cmt>MATAJUR, 1642 m, je najvišja gora Matajurskega pogorja, ki ga sestavljajo gorske enote Kolovrat, Matajur in Mija. Matajur je osrednja gora pogorja; čez vrh poteka državna meja. Na jz. se na Livškem prevalu navezuje na dolgo sleme Kolovrata (najvišji vrh Kuk, 1243 m). Na sz. padajo strma, večji del skalnata pobočja v sotesko reke Nadiže, ločnice Matajurja od Mije (1243 m), ki je bila nekdaj del prvotnega Matajurja, pa jo je zareza Nadiže ločila od celote. J. položno pobočje vrha gore prehaja v Beneškoslovensko hribovje, razrezano s številnimi dolinami in grapami; zaradi dobrih naravnih pogojev segajo tod vasi precej visoko. Razčlenjena so tudi v. pobočja nad Soško dolino.  Matajur sestavljajo kredne kamnine, apnenec, lapor in brečija. Matajur je s svojimi geološko-petrografskimi pasovi, razvrščenimi v smeri od jv. proti sz. nadaljevanje in zaključek Dinarskega gorskega sistema. Na višini od 1000 do 1250 m obdajajo goro obsežne zmerno nagnjene terase z glavnimi matajurskimi planinami. Matajur je precej gozdnat, vendar so ga precej iztrebili za košenice in planine. Na j. pobočju je najvišja vas Matajur (955 m), na naši strani meje pa Avsa (800-900 m). Zaradi skromnih njiv na v. pobočjih se prebivalci ukvarjajo v glavnem z živinorejo, na j. položnejših pobočjih pa je zaradi ugodnejših klimatskih razmer in vpliva morja v niže ležečih predelih razvito sadjarstvo in poljedelstvo in tudi vinogradi segajo kar do 700 m visoko. Na obeh straneh meje so idealni smuški tereni, na naši strani na Livku.  Razgled z Matajurja je izredno lep. Na s. in sv. se širijo Julijske Alpe, tik nad dolino Soče se na desni mogočno dviga Krn, na levi pa se vleče hrbet Stola. Na j. so najprej pred nami hribčki Beneškoslovenskega hribovja, potem pa se širi Furlanska ravnina vse do Ogleja in Benetk. Na z. je v bližini Mija, za njo Breginjskikot, v dalji pa vidimo grebene Karnijskih Alp in vrhove Dolomitov. Proti v. vidimo pod nami pobočja Matajurja, dolino Soče in dolgi greben Spodnjih Bohinjskih gora, proti jv. pa hrbet Kolovrata in Kambreško pogorje.  Na naši strani meje ni planinske postojanke, na italijanski pa je 45 min pod vrhom koča Guglielmo Pelizzo (1320 m), do katere pripelje asfaltirana cesta. Na italijanski strani vrha je lepa kapelica, posvečena Kristusu Odrešeniku, ki so jo leta 1962 postavili na pobudo Čedajske sekcije Italijanskega alpinističnega kluba (CAI).</cmt>
	</wpt>
