	<cmt>Porezen (1630 m) je gora nad Baško grapo, Selško dolino in dolino Cerknice; je najvišji vrh Cerkljanskega hribovja. Na jv. strani se nadaljuje v Počanski gori (1259 m), na jz. strani pa stoji Kojca (1303 m). Porezen je grajen iz apnencev in skrilavcev. S. in v. pobočja so gozdnata, j. in z. pa so večinoma pokrita s pašniki in senožetmi. Na Poreznu raste značilno alpsko cvetje, med drugimi lepi jeglič, panonski svišč in alpska možina.</cmt>
