	<cmt>Južno od Peska se dviga Rogla (1517 m), najvišji vrh v osrednjem delu Pohorja; na njem stoji 30 m visok kovinski razgledni stolp, ki ga je postavilo PD Slovenske Konjice. S stolpa seže pogled do lvanščice, Medvednice, Gorjancev, Snežnika, Julijcev, Kamniških in Savinjskih Alp, Pece, Golice, Kozjaka in Slovenskih goric, ob čistem ozračju tudi do Visokih in Nizkih Tur, Štajerskih Alp in Panonske nižine. Malo naprej od stolpa je RTČ Rogla s hotelom Planja. S Peska do razglednega stolpa je 30, do hotela Planja pa 45 min. Če želimo ob SPP obiskati še Roglo, napravimo ovinek mimo razglednega stolpa in hotela Planja do sedla Komisija na s. strani Ostruščice, kjer se znova pridružimo SPP s Peska. Pot je označena, je pa uro daljša od direktne smeri.</cmt>
