	<cmt>STOL, 1673 m, je najvišji vrh slovenskega dela Stolovega pogorja. Celotno pogorje se razteza od Soške doline med Kobaridom in Žago na v. do Humina (Gemona del Friuli) v dolini reke Tilment v Beneški Sloveniji. Pogorje je pravzaprav 35 km dolgo sleme, ki je najdaljše v Julijskih Alpah. Na območju Drnohle, z. od Stola, ga prečka državna meja; ena tretjina pogorja je v naši državi, večji del v Italiji. Najvišji vrh je Veliki Karman (Chiampon), 1710 m, na skrajnem z. robu. Reka Ter prereže pogorje na obširnejši in lažje dostopni vzhodni del ter na manjši, skalnati zahodni del.</cmt>
