	<cmt>Uršlja gora (1699 m), staro ime Plešivec, je najvzhodnejši vrh v Karavankah, ki se še dviga nad gozdno mejo. Ime Plešivec je gora dobila po travnatem vrhu, zato se od juga vidi, kot bi bila plešasta. Ime Uršlja gora pa ima po gotski cerkvi sv. Uršule, ki so jo leta 1602 zgradili kmetje iz okoliških krajev na pobudo tedanjega ljubljanskega škofa Tomaža Hrena. Prebivalci Mežiške doline jo imenujejo le Gora. Grajena je iz apnencev in dolomitov, vmes pa so plasti skrilavcev in laporjev.</cmt>
