	<wpt lat="45.5885" lon="14.4476">
	<ele>1795</ele>
	<name>Veliki Snežnik</name>
	<cmt>VELIKI SNEŽNIK, 1796 m, je najvišji vrh v visoki Snežniški planoti, ki se vzpenja nad Cerkniškim, Loškim in Babnim poljem na sv. ter nad Reško dolino in dolino Zgornje Pivke na jz. Planota se na sz. spušča v Postojnska vrata, ki jo ločijo od Hrušice, na jv. pa jo zareza Gomanjškega prečnega dola loči od Snježnika, Risnjaka in drugih gora Gorskega Kotarja. Snežniška planota spada v Dinarski gorski sistem; povečini sestoji iz krednega apnenca in dolomita. Na njenem zakraselem površju se vrstijo nešteti kotliči, vrtače in brezna, drage in doli, med njimi se dvigajo številni čoki, roglji ter nižji in višji oblasti vrhovi in gore. Po vsej planoti rastejo do višine okrog 1500 m nepregledni smrekovi in bukovi gozdovi, prepreženi z gosto mrežo gozdnih cest, v njih pa je tudi več gozdarskih in lovskih postojank. Snežnik je le 28 km oddaljen od morja, zato ima obilo padavin, pozimi snega, ki leži dolgo v pomlad; kljub temu tu ni potokov, ker voda sproti izginja v kraški svet in pod površjem odteka v pritoke Pivke, Unca, Reke, Rečine in Kolpe. V ledeni dobi je bila okolica Snežnika pokrita z ledom. V snežniških gozdovih, tudi v bližini vrha, je mnogo kotlin-mrazišč, kjer je temperatura stalno nižja in pade pozimi do —32° C.  Snežnik ima dva vrha: Veliki Snežnik, na katerem je planinsko zavetišče, in sosednji Mali Snežnik (1688 m), ki ga od Velikega loči le sedlo. Ponekod dodajajo imenu Snežnik še oznako Notranjski, da bi ga ločili od Goteniškega Snežnika. Zaradi redke planinske flore je bilo območje nad 1450 m okoli Malega in Velikega Snežnika leta 1964 razglašeno z republiško odredbo za naravno znamenitost. Tod rastejo travnolistna vrčica, Scopolijev repnjak, Justinova zvončica, kobulnica, dlakavi sleč, kraška vrsta planike, rdeča murka, Clusijev svišč, panonski svišč in druge cvetice.  Valvasor je o Snežniku zapisal v svoji Slavi vojvodine Kranjske:  »Ta gora, ki se na splošno Snežnik imenuje, je s svojim 124 koničastim vrhom pravi prebijač oblakov. Dvigne se tako visoko, da se z njegovega vrha lahko tvoje oko sprehaja po vsej deželi daleč naokrog in da lahko tvoji vidni žarki poletijo tudi preko morja v Italijo, v Dalmacijo, Hrvaško, v Turčijo in vsepovsod naokoli. « K Valvasorjevemu razgledu ni kaj dodati, le Bosna ni več turška.</cmt>
	</wpt>
