	<wpt lat="46.2574" lon="14.8163">
	<ele>1505</ele>
	<name>Vivodnik</name>
	<cmt>MENINA PLANINA je visoka kraška planota, ki jo prištevamo h Kamniškim in Savinjskim Alpam. Razprostira se med Gornjegrajsko kotlino na s. in Tuhinjsko dolino na j. ter od prelaza Črnivec (902 m) na z. do prevala Lipa (721 m) na v. Na Črnivcu se Menina navezuje na Veliko planino, prek Lipe pa se veže z Dobrovljami. Ime Menina izvira iz besede »Menihna« po menihih iz Gornjega Grada, ki jim je pripadala tudi Menina. Vršina planote meri po dolgem ok. 10, v širino pa ok. 5 km; višina se giblje med 1200 in 1500 m. Planota je zgrajena iz srednje in zgornjetriasnih apnencev in dolomitov, na s. pobočju je več krp vulkanskih sprimkov. Površje je razjedeno s kotliči, brezni in vrtačami. Precej strma pobočja so poraščena z iglastimi in mešanimi gozdovi, na planoti pa je precej planin (pašnikov), med njimi Globače, Gospodnja planina, Ravni, Travnik in Biba planina. Na Menini raste bogata alpska flora, med živalmi pa zasledimo srnjad, jelenjad, gamse in divje peteline.  Najvišji vrh je Vivodnik (1508 m), na njem je razgledni stolp, ki ga je postavilo PD Gornji Grad; od planinskega doma je oddaljen 15 min. Razgleden je tudi Goli vrh (1426 m) v. od planine Šavnice. Znana naravna znamenitost je ledena jama Jespa, 15 min ob. poti proti Gornjemu Gradu; to je okrog 20 m široko in približno toliko globoko kraško brezno, kjer se še poleti zadržuje sneg, v nadaljevanju jame pa tudi led. Druga naravna znamenitost je jezerce Biba na sredini poti med Domom na Menini in planšarijo na Bibi planini; v zadnjih letih se je precej zmanjšalo, dolgo je 50 m, široko 50 m in globoko 2 m. Leži v kotanji, voda je temne barve zaradi blata na dnu, vendar je čista.  Z razglednega stolpa na Vivodniku je obsežen razgled. Proti v. vidimo čez planoto Menine planine Dobrovlje, Paški Kozjak, Boč in Donačko goro. Na jv. strani se dviga Posavsko hribovje s Čemšeniško planino, Kumom, Mrzlico, Lisco in Bohorjem, naprej pa so Medvednica in Gorjanci. Na j. je v bližini hribovje Šipek med Tuhinjsko dolino in Črnim grabnom, na obzorju pa vidimo Snežnik, Javornike in Nanos. Najlepši je pogled proti z. , kjer so za Veliko planino vrhovi Kamniških in Savinjskih Alp, levo od njih pa Škofjeloško pogorje, Jelovica in Julijci s Triglavom. Od z. proti s. vidimo v bližini Kranjsko reber, Lepenatko in Veliki Rogac, naprej Olševo, Raduho in Peco, na s. nad Gornjo Savinjsko dolino Travnik, Komen, Smrekovec in Golte, potem pa Uršljo goro, Paški Kozjak in Pohorje.</cmt>
	</wpt>
