	<cmt>Vogel (1922 m) je piramidast vrh v osrčju Spodnjih Bohinjskih gora. Po vrhu je poimenovano tudi širše območje na njegovi s. strani, kjer je turistični center Vogel z žičnicami, vlečnicami in smučarskimi progami. Na robu nad Bohinjsko dolino stoji na Rjavi skali (1540 m) Ski hotel, do katerega je iz doline speljana gondolska žičnica. Na tem mestu je Turistovski klub »Skala« zgradil leta 1934 »Skalaški dom«, ki pa je med 2. svetovno vojno pogorel. V bližini stoji Planinska koča Merjasec na Voglu (telefon 04/ 5768790). Gondolska žičnica precej skrajša pristop na Vogel; od Ski hotela je čez planino Zadnji Vogel 2 h. Če obratuje sedežnica na Visoki Orlov rob (1800 m) pod vrhom Šije, pa je do vrha le še 1 h 30.</cmt>
