	<cmt>Vršič (1737 m) je vzpetina v slemenu med Prisojnikom in Mojstrovko. Že ime pove, da se ne more meriti s svojimi visokimi skalnatimi sosedi. Ko se peljemo ali gremo iz Kranjske Gore po vršiški cesti, zagledamo pred seboj obraslo glavico, ki čepi nad dolino Suhe Pišnice; to je Vršič. Vzpetina je porasla z rušjem in macesni, nad Erjavčevo kočo je plazovita, v bližini Poštarskega doma pa so med rušjem tudi večje travnate površine.</cmt>
